[{"operationName":"membershipQuery","variables":{"userId":"20430477"},"query":"query membershipQuery($userId: String!) {
  ProgramMembershipsV2Resource {
    byUser(userId: $userId) {
      elements {
        id
        enterpriseProgram {
          id
          thirdPartyOrganizationId
          browsingExperience {
            id
            browsingExperience
            __typename
          }
          metadata {
            slug
            name
            description
            endedAt
            launchedAt
            curriculumId
            __typename
          }
          __typename
        }
        membershipState
        programId
        createdAt
        userId
        __typename
      }
      __typename
    }
    __typename
  }
  DegreeLearnerMembershipsV1Resource {
    byUser(userId: $userId) {
      elements {
        id
        createdAt
        degreeId
        role
        degree {
          id
          name
          slug
          internalLaunchType
          supportEmailAddress
          partnerIds
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
  ProgramSwitcherSelectionsV1Resource {
    get(id: $userId) {
      id
      selectionType
      programId
      degreeId
      __typename
    }
    __typename
  }
}
"},{"operationName":"semiPersonalizedRecommendationsQuery","variables":{"id":"people-who-viewed-converted-cdp-algo$course~lVXdKg4PEee3mA5YKds-dg$no_attribute"},"query":"query semiPersonalizedRecommendationsQuery($id: String!) {
  SemiPersonalizedRecsModulesV1Resource {
    get(id: $id) {
      id
      entities {
        entityId
        __typename
      }
      courses {
        elements {
          s12ns {
            elements {
              id
              __typename
            }
            __typename
          }
          id
          slug
          name
          partnerIds
          photoUrl
          partners {
            elements {
              id
              name
              squareLogo
              __typename
            }
            __typename
          }
          courseTypeMetadata {
            courseTypeMetadata {
              ...RhymeProjectFragment
              __typename
            }
            __typename
          }
          __typename
        }
        __typename
      }
      s12ns {
        elements {
          id
          name
          productVariant
          courses {
            paging {
              total
              __typename
            }
            __typename
          }
          logo
          partners {
            elements {
              id
              name
              squareLogo
              __typename
            }
            __typename
          }
          slug
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment RhymeProjectFragment on CourseTypeMetadataV1_rhymeProjectMember {
  ... on CourseTypeMetadataV1_rhymeProjectMember {
    rhymeProject {
      typeNameIndex
      __typename
    }
    __typename
  }
  __typename
}
"},{"operationName":"coursesQuery","variables":{"courseIds":["jnLavMk5EeeVPQ7WIasyYA","2x3878rgEee3yRKskKT_NA","WwC0idEkEeer0xJUQzVHIg"]},"query":"query coursesQuery($courseIds: [String!]!) {
  CoursesV1Resource {
    multiGet(ids: $courseIds) {
      elements {
        id
        slug
        name
        partnerIds
        photoUrl
        partners {
          elements {
            id
            name
            squareLogo
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
